import React, { useEffect, useState } from "react";
import { IoCalendarNumber, IoMdNotifications, IoMdSunny, IoIosMoon } from "react-icons/io5";
import { BiLogOut, BiSolidDashboard } from "react-icons/bi";
import { MdOutlineWatchLater } from "react-icons/md";
import { AiOutlineSchedule, AiOutlineBarChart } from "react-icons/ai";
import { useNavigate, useLocation } from "react-router-dom";
import icon from "../utils/icon.PNG";
import Notification from "./Notification/Notification";
import axios from 'axios';
import Aos from "aos";
import "aos/dist/aos.css";
import { toast } from "react-toastify";


const Navbar = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const [user, setUser] = useState({});
  const [upcomingTasks, setUpcomingTasks] = useState([]);
  const [dialog, setDialog] = useState(false);

  useEffect(() => {
    Aos.init({ duration: 800 });
    // Giả sử endpoint lấy thông tin user và tasks
    axios.get(`${process.env.REACT_APP_API_URL}/getUser`)
      .then(res => setUser(res.data))
      .catch(err => console.error(err));

    axios.get(`${process.env.REACT_APP_API_URL}/task/getTasks`)
      .then(res => setUpcomingTasks(res.data.filter(task => !task.done)))
      .catch(err => console.error(err));
  }, []);

  const toggleDialog = () => setDialog(!dialog);
  const toggleDarkMode = e => {
    document.body.setAttribute('data-theme', e.target.checked ? 'dark' : 'light');
  };

  function logOut() {
    toast.success("Logged out successfully");
    navigate("/");
  }

  const navItems = [
    { path: "/Home", label: "Dashboard", icon: <BiSolidDashboard size={22} color="white" /> },
    { path: "/Home/projects", label: "Project", icon: <LuListTodo size={20} color="white" /> },
    { path: "/Home/focus", label: "Focus", icon: <MdOutlineWatchLater size={20} color="white" /> },
    { path: "/Home/timetable", label: "TimeTable", icon: <AiOutlineSchedule size={20} color="white" /> },
    { path: "/Home/calendar", label: "Calendar", icon: <IoCalendarNumber size={20} color="white" /> },
    { path: "/Home/report", label: "Report", icon: <AiOutlineBarChart size={20} color="white" /> },
  ];

  return (
    <nav className="nav-left" data-aos="fade-right">
      <button className="awaretime-theme">
        <img src={icon} alt="App Icon" />
      </button>
      <div className="profile-controls">
        <button onClick={toggleDialog}>
          <IoMdNotifications size={25} color="#3081D0" />
          {upcomingTasks.length > 0 && <span className="notification-count">{upcomingTasks.length}</span>}
        </button>
        <label htmlFor="dark-mode-toggle">
          <input type="checkbox" id="dark-mode-toggle" onChange={toggleDarkMode} />
          <IoMdSunny size={16} />
          <IoIosMoon size={16} />
        </label>
        <div className="user-icon">
          <img src={user.picUrl || '/default-user.png'} alt="User" style={{ width: 30, height: 30, borderRadius: '50%' }} />
        </div>
      </div>
      {navItems.map((item) => (
        <button
          key={item.path}
          onClick={() => navigate(item.path)}
          className={`nav-icon skull ${location.pathname === item.path ? "active" : ""}`}
        >
          {item.icon}
        </button>
      ))}
      <button className="nav-icon skull" onClick={logOut}>
        <BiLogOut size={22} color="white" />
      </button>
      {dialog && <Notification closeNotifi={toggleDialog} upcomingTasks={upcomingTasks} />}
    </nav>
  );
};

export default Navbar;
